    true,nt"url": null,nt"notes": "The Global Subnational Infant Mortality
    Rates consists of estimates of infant mortality rates nnfor the year 2000. The infant
    mortality rate for a region or country is defined as the number of children who
    die before their first nnbirthday for every 1,000 live births. The data products
    include a shapefile (vector data) of rates, grids (raster data) of rates (per nn10,000
    live births in order to preserve precision in integer format), births (the rate
    denominator) and deaths (the rate numerator), nnand a tabular dataset of the same
    and associated data. Over 10,000 national and subnational units are represented
    in the tabular and nngrid datasets, while the shapefile uses approximately 1,000
    units in order to protect the intellectual property of source datasets nnfor Brazil,
    China, and Mexico. This dataset is produced by the Columbia University Center for
    International Earth Science Information nnNetwork (CIESIN).",nt"license_title":
